<script setup>

const map = ref(null);
const dots = ref(null);

function checkGrid() {
  const gridWidth = map.value.offsetWidth;
  const gridHeight = map.value.offsetHeight;
  const gridSize = 15;

  const mapRect = map.value.getBoundingClientRect();

  const rows = Math.ceil(gridHeight / gridSize);
  const cols = Math.ceil(gridWidth / gridSize);

  console.log('mapRect:', mapRect);
  console.log('gridWidth:', gridWidth);
  console.log('gridHeight:', gridHeight);
  console.log('rows:', rows);
  console.log('cols:', cols);
  console.log('map.value.offsetLeft:', map.value.offsetLeft);
  console.log('map.value.offsetTop:', map.value.offsetTop);

  const newDots = [];
  const countries = {};
  let x, y, element;
  let smallestI, smallestJ
  for(let i = 0; i < rows; i++) {
    for(let j = 0; j < cols; j++) {
      x = j * gridSize + mapRect.x;
      y = i * gridSize + mapRect.y;

      element = document.elementFromPoint(x, y);

      if(element && element.id && element.id.length == 2) {
        newDots.push({
          x: j,
          y: i,
          id: element.id
        });

        if(!countries[element.id]) {
          countries[element.id] = 0;
        }
        countries[element.id]++;

        smallestI = smallestI === undefined ? i : Math.min(smallestI, i);
        smallestJ = smallestJ === undefined ? j : Math.min(smallestJ, j);
      }
      // console.log(`Element at (${x}, ${y}):`, element);

    }
  }
  console.log('countries:', countries);

  // for(let i = 0; i < newDots.length; i++) {
  //   newDots[i].x -= smallestJ;
  //   newDots[i].y -= smallestI;
  // }

  const result = {
    rows: rows,
    cols: cols,
    dots: newDots
  };
  
  dots.value = result;
  console.log('Dots:', result);
}

onMounted(() => {
  checkGrid();
});

</script>

